import PropTypes from 'prop-types';
function Book({title, author, isbn, year}){

    function clicked(){
        console.log("clicked");
    }
    return(
        <table>
            <tr draggable="true" onClick={clicked}>
                <td>{title}</td>
                <td>{author}</td>
                <td>{isbn}</td>
                <td>{year}</td>
            </tr>
        </table>
    )
}
Book.propTypes={
    title: PropTypes.string,
    author: PropTypes.string,
    isbn: PropTypes.number,
    year: PropTypes.string
}
export default Book;
